void run_jacobi(std::vector<std::tuple<string, string, int>> &cases){
    for (size_t i = 0; i < cases.size(); ++i) {
        BN x = BN::FromHexStr(std::get<0>(cases[i]));
        BN n = BN::FromHexStr(std::get<1>(cases[i]));
        int jacobi = std::get<2>(cases[i]);
        EXPECT_EQ(BN::JacobiSymbol(x, n), jacobi);
    }
}

TEST(BN, JACOBI_x_pq) {
    run_jacobi(cases_jacobi_x_pq);
}

TEST(BN, JACOBI_x_p) {
    run_jacobi(cases_jacobi_x_p);
}

TEST(BN, JACOBI_x_pq4096) {
    run_jacobi(cases_jacobi_x_pq4096);
}

TEST(BN, Jacobi_General)
{
    // (1001, 9907) = -1
    BN k(1001);
    BN n(9907);
    EXPECT_TRUE(BN::JacobiSymbol(k, n) == -1);

    // (19, 45) = 1
    k = BN(19);
    n = BN(45);
    EXPECT_TRUE(BN::JacobiSymbol(k, n) == 1);

    // (8, 21) = -1
    k = BN(8);
    n = BN(21);
    EXPECT_TRUE(BN::JacobiSymbol(k, n) == -1);

    // (5, 21) = 1
    k = BN(5);
    n = BN(21);
    EXPECT_TRUE(BN::JacobiSymbol(k, n) == 1);

    // (12345, 3371) = -1
    k = BN(12345);
    n = BN(3371);
    EXPECT_TRUE(BN::JacobiSymbol(k, n) == -1);
}


